const axios = require("axios");

axios({
    method: "POST",
    url: "https://detect.roboflow.com/piece-detection-htwfo/3",
    params: {
        api_key: "wVYU7nFOaWHQOQDx9eYU",
        image: "https://sweethillwood.com/images/thumbs/0002223_wood-chess-board-black-walnut-and-curly-maple-2-inch-squares.jpeg"
    }
})
.then(function(response) {
    console.log(response.data);
})
.catch(function(error) {
    console.log(error.message);
});
